import React, { useState, useEffect } from "react"
import "./Devui.css"
import { Row, Col, Form } from "react-bootstrap"
import Navigation from "./Navigation"

const Devui = () => {

    const [internname, setInternname] = useState([])

    useEffect(() => {


        fetch("https://reqres.in/api/users?page=2", {
            method: 'GET',
        })
            .then((apidata1) => {
                return apidata1.json()
            })
            .then((actualdata1) => {
                console.log(actualdata1.data)
                setInternname(actualdata1.data)
            }
            )
    }, [])

    return (
        <>
            <Row className="mb-5">
                <Navigation />
            </Row>
            <Row className="listingpgtopbg mt-4">
                <Col sm={4} className=" mt-5 ">
                    {
                        internname.length > 0 ?
                            internname.map(key => (
                                <Row className="internname">
                                    {key.first_name}
                                </Row>
                            ))
                            :
                            null
                    }
                </Col>
                <Col sm>
               
                </Col>
            </Row>

            <Row>
                <Col sm={4}>
                    
                </Col>
                <Col sm={8}></Col>
            </Row>

        </>
    )
}

export default Devui
